import React, { useState } from "react";
import { HeaderLinks, Icons } from "./Constants";
import {
  ToggleMenu,
  ToggleClose,
  ToggleMenuItems,
  ToggleMenuMain,
  ToggleButton,
  ToggleButtonLines,
  ToggleButtonLine,
  ToggleNavLink,
  IconLi,
  Icon
} from "./Fragments";

const ToggleNav = () => {
  const [toggle, setToggle] = useState(false);
  return (
    <>
      {toggle && (
        <ToggleMenu>
          <ToggleClose />
          <ToggleMenuItems>
            <ToggleMenuMain>
              {HeaderLinks.map(
                (link, index) =>
                  link.primary && (
                    <ToggleNavLink key={index} href={link.value}>
                      {link.text}
                    </ToggleNavLink>
                  )
              )}
            </ToggleMenuMain>
            <div>
              {HeaderLinks.map(
                (link, index) =>
                  !link.primary && (
                    <ToggleNavLink key={index} href={link.value}>
                      {link.text}
                    </ToggleNavLink>
                  )
              )}
              <ul className="mt-1">
                {Icons.map((icon, index) => (
                  <IconLi class="app-icon app-icon-ios">
                    <Icon href={icon.href} title={icon.text} url={icon.url}>
                      {icon.text}
                    </Icon>
                  </IconLi>
                ))}
              </ul>
            </div>
          </ToggleMenuItems>
        </ToggleMenu>
      )}
      <ToggleButton onClick={() => setToggle(!toggle)}>
        <ToggleButtonLines>
          <ToggleButtonLine />
          <ToggleButtonLine />
          <ToggleButtonLine />
        </ToggleButtonLines>
      </ToggleButton>
    </>
  );
};
export default ToggleNav;
